    'help.HowDoIChangeAPicture': '\u092E\u0948\u0902 \u091A\u093F\u0924\u094D\u0930 \u0915\u094B \u0915\u0948\u0938\u0947 \u092C\u0926\u0932 \u0938\u0915\u0924\u093E \u0939\u0942\u0902?',
    'help.HowDoIChangeAPicture_content': '\u0935\u093F\u091C\u094D\u091E\u093E\u092A\u0928 \u0915\u0947 \u0938\u0902\u092A\u093E\u0926\u0928 \u0915\u0940 \u091C\u094B \u092A\u094D\u0930\u0915\u094D\u0930\u093F\u092F\u093E \u0939\u0948, \u0909\u0938\u0940 \u0915\u093E \u0905\u0928\u0941\u0938\u0930\u0923 \u0915\u0930\u0915\u0947 \u0906\u092A \u091A\u093F\u0924\u094D\u0930 \u0915\u094B \u092D\u0940 \u0938\u0902\u092A\u093E\u0926\u093F\u0924 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964 \u0938\u0902\u092A\u093E\u0926\u0928 \u092A\u0943\u0937\u094D\u0920 \u092E\u0947\u0902 \u091C\u093E\u0915\u0930 \u092B\u094B\u091F\u094B \u0935\u093E\u0932\u0947 \u0905\u0928\u0941\u092D\u093E\u0917 \u092E\u0947\u0902 \u091C\u093E\u090F\u0902 \u0914\u0930 \u092B\u094B\u091F\u094B \u0939\u091F\u093E\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F \u201C\u092F\u0939 \u092B\u094B\u091F\u094B \u0939\u091F\u093E\u090F\u0902\u201D \u092A\u0930 \u0915\u094D\u0932\u093F\u0915 \u0915\u0930\u0947\u0902 \u0914\u0930 \u0928\u092F\u093E \u091A\u093F\u0924\u094D\u0930 \u0905\u092A\u0932\u094B\u0921 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F \u201C\u0926\u0942\u0938\u0930\u093E \u092B\u094B\u091F\u094B \u091C\u094B\u0921\u093C\u0947\u0902\u201D \u092A\u0930 \u0915\u094D\u0932\u093F\u0915 \u0915\u0930\u0947\u0902\u0964',
