    'help.WhatAreClassifieds_content': '\u0935\u0930\u094D\u0917\u0940\u0915\u0943\u0924 \u0936\u0948\u0932\u0940 \u0915\u0947 \u0935\u093F\u091C\u094D\u091E\u093E\u092A\u0928\u094B\u0902 \u092E\u0947\u0902 \u0916\u0930\u0940\u0926\u093E\u0930 \u0939\u092E\u0947\u0936\u093E \u0935\u093F\u0915\u094D\u0930\u0947\u0924\u093E \u0938\u0947 \u0938\u0902\u092A\u0930\u094D\u0915 \u0915\u0930\u0915\u0947 \u092D\u093E\u0935 \u0915\u093E \u092E\u094B\u0932-\u0924\u094C\u0932 \u0915\u0930\u0947\u0902\u0917\u0947, \u0924\u092C \u092D\u0940 \u091C\u092C \u0935\u093F\u0915\u094D\u0930\u0947\u0924\u093E \u0905\u092A\u0928\u0940 \u0935\u0938\u094D\u0924\u0941 \u0915\u0940 \u0915\u0940\u092E\u0924 \u0938\u094D\u092A\u0937\u094D\u091F \u0915\u0930 \u0926\u0947\u0964',
