    'featured_listings.AdditionalTermsForFeaturedAds_content': '\u092F\u0947 \u0905\u0924\u093F\u0930\u093F\u0915\u094D\u0924 \u0936\u0930\u094D\u0924\u0947\u0902, \u0935\u0947\u092C\u0938\u093E\u0907\u091F \u0915\u0940 <<LINK_TERMS_USE>>\u0909\u092A\u094B\u092F\u0917 \u0915\u0940 \u0936\u0930\u094D\u0924\u094B\u0902 <</LINK_TERMS_USE>> \u0915\u0947 \u0938\u093E\u0925, \u092B\u0940\u091A\u0930\u093F\u0924 \u0935\u093F\u091C\u094D\u091E\u093E\u092A\u0928\u094B\u0902 \u0915\u0947 \u0909\u092A\u092F\u094B\u0917 \u0915\u094B \u0928\u093F\u092F\u092E\u093F\u0924 \u0915\u0930\u0924\u0940 \u0939\u0948\u0902:<br /><ul><li>\u092B\u0940\u091A\u0930\u093F\u0924 \u0935\u093F\u091C\u094D\u091E\u093E\u092A\u0928 \u0915\u0940 \u0905\u0926\u093E\u092F\u0917\u0940 \u0915\u0947 \u092A\u094D\u0930\u092E\u093E\u0923 \u0915\u0947 \u0930\u0942\u092A \u092E\u0947\u0902 OLX \u0915\u0947\u0935\u0932  \u201C\u0906\u0926\u0947\u0936 \u0915\u0940 \u092A\u0941\u0937\u094D\u091F\u093F\u201D, \u091C\u093F\u0938\u0947 \u0906\u092A \u0905\u0926\u093E\u092F\u0917\u0940 \u092A\u094D\u0930\u0915\u094D\u0930\u093F\u092F\u093E \u0915\u0947 \u0905\u0902\u0924 \u092E\u0947\u0902 \u0926\u0947\u0916 \u0938\u0915\u0947\u0902\u0917\u0947, \u0914\u0930 \u090F\u0915 \u0908\u092E\u0947\u0932 \u092A\u0941\u0937\u094D\u091F\u093F \u091C\u093E\u0930\u0940 \u0915\u0930\u0947\u0917\u093E\u0964</li><li>\u092F\u0926\u093F \u0924\u0915\u0928\u0940\u0915\u0940 \u092F\u093E \u0905\u0928\u094D\u092F \u0915\u093F\u0938\u0940 \u0915\u093E\u0930\u0923 \u0938\u0947 \u0906\u092A\u0915\u093E \u0935\u093F\u091C\u094D\u091E\u093E\u092A\u0928 \u201C\u092B\u0940\u091A\u0930\u093F\u0924 \u0935\u093F\u091C\u094D\u091E\u093E\u092A\u0928\u201D \u0915\u094D\u0937\u0947\u0924\u094D\u0930 \u092E\u0947\u0902 \u0928 \u0926\u093F\u0916\u093E\u0908 \u0926\u0947, \u0924\u094B OLX \u0915\u0940 \u092C\u0938 \u0907\u0924\u0928\u0940 \u0939\u0940 \u091C\u093F\u092E\u094D\u092E\u0947\u0926\u093E\u0930\u0940 \u0930\u0939\u0947\u0917\u0940 \u0915\u093F \u0939\u092E \u0909\u0938\u0947 \u0939\u092E\u093E\u0930\u0947 \u0932\u093F\u090F \u091C\u093F\u0924\u0928\u0940 \u091C\u0932\u094D\u0926 \u0938\u0902\u092D\u0935 \u0939\u094B, \u092B\u0940\u091A\u0930\u093F\u0924 \u0915\u094D\u0937\u0947\u0924\u094D\u0930 \u092E\u0947\u0902 \u0926\u093F\u0916\u093E\u090F\u0902\u0964</li><li>\u0939\u092E\u093E\u0930\u0947 \u092C\u093F\u0932\u093F\u0902\u0917 \u0938\u092E\u093E\u0927\u093E\u0928 \u0915\u0947 \u092A\u094D\u0930\u0926\u093E\u0924\u093E \u090F\u0915 \u0905\u0928\u094D\u092F \u092A\u0915\u094D\u0937 \u0939\u0948\u0964 </li><li>OLX \u0915\u0940 \u090F\u0915\u092E\u093E\u0924\u094D\u0930 \u0907\u091A\u094D\u091B\u093E \u0915\u0947 \u0905\u0928\u0941\u0938\u093E\u0930, \u0915\u093F\u0938\u0940 \u0910\u0938\u0947 \u0935\u093F\u091C\u094D\u091E\u093E\u092A\u0928 \u0915\u094B, \u091C\u094B \u0906\u092A\u0924\u094D\u0924\u093F\u091C\u0928\u0915 \u0939\u094B, \u0905\u0936\u094D\u0932\u0940\u0932 \u0939\u094B, \u0905\u0935\u093E\u0902\u091B\u093F\u0924 \u0939\u094B (\u091C\u093F\u0938\u092E\u0947\u0902 \u0926\u0941\u0939\u0930\u093E\u090F \u0917\u090F \u0932\u093F\u0938\u094D\u091F\u093F\u0902\u0917 \u092D\u0940 \u0936\u093E\u092E\u093F\u0932 \u0939\u0948\u0902) \u0938\u0902\u092D\u093E\u0935\u093F\u0924 \u0918\u094B\u091F\u093E\u0932\u093E \u0939\u094B, \u092F\u093E \u091C\u094B \u0915\u093F\u0938\u0940 \u0915\u0947 \u0915\u093E\u092A\u0940\u0930\u093E\u0907\u091F \u0915\u093E \u0909\u0932\u094D\u0932\u0902\u0918\u0928 \u0915\u0930\u0924\u0947 \u0939\u094B\u0902, \u092B\u0940\u091A\u0930\u093F\u0924 \u0928\u0939\u0940\u0902 \u0915\u093F\u092F\u093E \u091C\u093E\u090F\u0917\u093E \u0914\u0930 \u0909\u0938\u0915\u0947 \u0932\u093F\u090F \u0915\u093F\u090F \u0917\u090F \u092D\u0941\u0917\u0924\u093E\u0928 \u0915\u094B \u0932\u094C\u091F\u093E\u092F\u093E \u0928\u0939\u0940\u0902 \u091C\u093E\u090F\u0917\u093E\u0964</li><li>\u092F\u0939 \u092B\u0940\u091A\u0930\u093F\u0924 \u0938\u0947\u0935\u093E "\u091C\u0948\u0938\u0940 \u0935\u0939 \u0939\u0948" \u092F\u093E "\u091C\u0948\u0938\u0940 \u0935\u0939 \u0909\u092A\u0932\u092C\u094D\u0927 \u0939\u0948" \u0915\u0947 \u0906\u0927\u093E\u0930 \u092A\u0930 \u092A\u094D\u0930\u0926\u0924\u094D\u0924 \u0915\u0940 \u091C\u093E \u0930\u0939\u0940 \u0939\u0948, \u0914\u0930 \u0909\u0938\u0915\u0947 \u0932\u093F\u090F \u0915\u093E\u0928\u0942\u0928 \u0926\u094D\u0935\u093E\u0930\u093E \u0938\u0902\u092A\u0942\u0930\u094D\u0923 \u0930\u0942\u092A \u0938\u0947 \u0905\u0928\u0941\u092E\u0924 \u0915\u093F\u0938\u0940 \u092D\u0940 \u092A\u094D\u0930\u0915\u093E\u0930 \u0915\u0940 \u0917\u093E\u0930\u0902\u091F\u0940 \u0909\u092A\u0932\u092C\u094D\u0927 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964  OLX \u092B\u0940\u091A\u0930\u093F\u0924 \u0935\u093F\u091C\u094D\u091E\u093E\u092A\u0928 \u0938\u0947\u0935\u093E \u092E\u0947\u0902 \u0932\u093F\u0938\u094D\u091F \u0915\u0940 \u0917\u0908 \u0935\u093F\u0937\u092F\u0935\u0938\u094D\u0924\u0941 \u0915\u0940 \u0938\u091F\u0940\u0915\u0924\u093E \u092F\u093E \u0938\u0902\u092A\u0942\u0930\u094D\u0923\u0924\u093E \u0915\u0947 \u092C\u093E\u0930\u0947 \u092E\u0947\u0902 \u0915\u094B\u0908 \u092D\u0940 \u0935\u093E\u0930\u0902\u091F\u0940 \u0928\u0939\u0940\u0902 \u0926\u0947\u0924\u093E \u0939\u0948 \u0914\u0930 \u0915\u094B\u0908 \u092D\u0940 \u0926\u093E\u0935\u0947 \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u093E \u0939\u0948 \u0914\u0930 \u0915\u094B\u0908 \u092D\u0940 \u091C\u093F\u092E\u094D\u092E\u0947\u0926\u093E\u0930\u0940 \u0928\u0939\u0940\u0902 \u0932\u0947\u0924\u093E \u0939\u0948\u0964</li></ul>',
